#pragma mark -
#pragma mark User Database:

// User database (use this for example to store the favorites user places)
// Returns FALSE upon error
- (BOOL)loadUserDatabase:(id)sender
{
	BOOL error = FALSE;
	NSArray *migrations = [NSArray arrayWithObjects:
						   [InitialUserTables migration],
						   nil
						   ];
	
	// to go back for example to remove the applied addtestTablemigration just change andMatchVersion:1
	[FmdbMigrationManager executeForDatabasePath:[self applicationSupportPathForFile:[NSString stringWithFormat:@"appdatabase.sqlite"]] withMigrations:migrations];
	
	self.userdb = [FMDatabase databaseWithPath:[self applicationSupportPathForFile:[NSString stringWithFormat:@"appdatabase.sqlite"]]];
	if (![self.userdb open]) {
		error = TRUE;
	}
	[self.userdb setLogsErrors:TRUE];
	
	return error;
}

// User database (use this for example to store the favorites user places)
// Returns FALSE upon error
- (BOOL)loadUserDatabaseForState:(NSString *)stateName
{
	BOOL error = FALSE;
	NSArray *migrations = [NSArray arrayWithObjects:
						   [InitialUserTables migration],
						   nil
						   ];
	
	// to go back for example to remove the applied addtestTablemigration just change andMatchVersion:1
	[FmdbMigrationManager executeForDatabasePath:[self applicationSupportPathForFile:[NSString stringWithFormat:@"%@_appdatabase.sqlite", stateName]] withMigrations:migrations];
	
	self.userdb = [FMDatabase databaseWithPath:[self applicationSupportPathForFile:[NSString stringWithFormat:@"%@_appdatabase.sqlite", stateName]]];
	if (![self.userdb open]) {
		error = TRUE;
	}
	[self.userdb setLogsErrors:TRUE];
	
	return error;
}

