	// Realestate suburbs
	NSArray *suburbsList = [suburbs componentsSeparatedByString:@","];
	for (NSString *name in suburbsList) {
		// get coordinates for suburb name
		name = [name capitalizedString];
		NSString *latitude = nil;
		NSString *longitude = nil;
		NSString *postcode = nil;
		NSString *state = stateName;
		FMResultSet *rs = [self.userdb executeQuery:@"select postcode,latitude,longitude from generated_suburbs where state = ? and name = ?", state, name];
		if ([rs next]) {
			postcode = [rs stringForColumn:@"postcode"];
			latitude = [rs stringForColumn:@"latitude"];
			longitude = [rs stringForColumn:@"longitude"];
		} else {
			NSLog(@"missed suburb name: %@ for state name: %@", name, stateName);
			
			sleep(3);
			
			// Use google api
			if (![name isEqualToString:@"Show All"]) {
				NSString *urlString = [self urlEncodeValue:[NSString stringWithFormat:@"http://maps.google.com/maps/geo?q=%@,%@&output=json&key=ABQIAAAA4yFxsxoDDepDo3ro17yA1hTjOjqphGs0Y9m3nFH3QZboM8-tuxRd5uNAoXEI-bEFHhLbT33JcyYACA", name, state]];
				NSData *responseData = [NSData dataWithContentsOfURL:[NSURL URLWithString:urlString]];
				
				if ([responseData length] != 0)  {
					NSString *jsonString = [[NSString alloc]initWithData:responseData encoding:NSUTF8StringEncoding];
					SBJSON *json = [[SBJSON alloc]init]; 
					NSDictionary* result = (NSDictionary *)[json objectWithString:jsonString error:nil];
					
					NSArray *placemarks = [result valueForKey:@"Placemark"];
					if (placemarks && [placemarks count] > 0) {
						NSDictionary *placemark = [placemarks objectAtIndex:0];
					
						NSArray *coordinates = [placemark valueForKeyPath:@"Point.coordinates"];
						if (coordinates && [coordinates count] > 1) {
							latitude = [NSString stringWithFormat:@"%@", [coordinates objectAtIndex:1]];
							longitude = [NSString stringWithFormat:@"%@", [coordinates objectAtIndex:0]];
							NSLog(@"google map api found suburb name: %@ for state name: %@", name, stateName);
						}
						
					}
					[jsonString release];
					[json release];
				}
			}
		}
		[rs close];
		
		NSString *fullAddress = nil;
		if (!postcode) {
			fullAddress = [NSString stringWithFormat:@"%@, %@", state,name];
		} else {
			fullAddress = [NSString stringWithFormat:@"%@, %@, %@", state,name,postcode];
		}
		
		// check if suburb already exist if not create
		// Check if suburb already exist if not create or else update
		NSNumber *suburb_id = [NSNumber numberWithInteger:[self.userdb intForQuery:@"select id from suburbs where name = ? and state = ?", name, state]];
		if ([suburb_id integerValue] == 0) {
			[self.userdb executeUpdate:@"insert into suburbs (postcode,name,state,latitude,longitude,full_address) values (?,?,?,?,?,?)", postcode, name, state, latitude, longitude, fullAddress];
			suburb_id = [NSNumber numberWithInteger:[self.userdb lastInsertRowId]];
		} else {
			[self.userdb executeUpdate:@"UPDATE suburbs SET postcode = ? where id = ?", postcode, suburb_id];
			[self.userdb executeUpdate:@"UPDATE suburbs SET name = ? where id = ?", name, suburb_id];
			[self.userdb executeUpdate:@"UPDATE suburbs SET state = ? where id = ?", state, suburb_id];
			[self.userdb executeUpdate:@"UPDATE suburbs SET latitude = ? where id = ?", latitude, suburb_id];
			[self.userdb executeUpdate:@"UPDATE suburbs SET longitude = ? where id = ?", longitude, suburb_id];
			[self.userdb executeUpdate:@"UPDATE suburbs SET full_address = ? where id = ?", fullAddress, suburb_id];
		}
	}
}

- (NSString *)urlEncodeValue:(NSString *)string
{
	CFStringRef originalURLString = (CFStringRef)string;
	CFStringRef preprocessedString = CFURLCreateStringByAddingPercentEscapes(NULL, originalURLString, NULL, (CFStringRef)@"", kCFStringEncodingUTF8);
	//CFStringRef urlString = CFURLCreateStringByAddingPercentEscapes(kCFAllocatorDefault, preprocessedString, NULL, (CFStringRef)@";/?:@&=+$", kCFStringEncodingUTF8);
	NSString *stringToReturn = [NSString stringWithString:(NSString *)preprocessedString];
	CFRelease(preprocessedString);
	return stringToReturn;
}

#pragma mark -
#pragma mark Utilities method to help find ressources from the applications directory or from the user directory:

// Permits to retrieve the path for the given file on the user documents dir
- (NSString *)documentPathForFile:(NSString *)aPath
{
	NSArray *paths = NSSearchPathForDirectoriesInDomains(NSDocumentDirectory, NSUserDomainMask, YES);
	NSString *documentsDirectory = [paths objectAtIndex:0];
	NSString *appFile = [documentsDirectory stringByAppendingPathComponent:aPath];
	return appFile;
}

// Permits to retrieve the path for the given file on the user application support dir
- (NSString *)applicationSupportPathForFile:(NSString *)aPath
{
	
    NSFileManager *fileManager;
    
    fileManager = [NSFileManager defaultManager];
	
	
	
	NSArray *paths = NSSearchPathForDirectoriesInDomains(NSApplicationSupportDirectory, NSUserDomainMask, YES);
	NSString *supportsDirectory = [([paths count] > 0) ? [paths objectAtIndex:0] : NSTemporaryDirectory() stringByAppendingPathComponent:@"AppDatabaseGenerator"];
	
	if ( ![fileManager fileExistsAtPath:supportsDirectory isDirectory:NULL] ) {
        [fileManager createDirectoryAtPath:supportsDirectory attributes:nil];
    }
	
	NSString *appFile = [supportsDirectory stringByAppendingPathComponent:aPath];
	return appFile;
}

// Permits to retrive the path for the given file on the application ressources dir
- (NSString *)bundlePathForRessource:(NSString *)aRessource ofType:(NSString *)aType
{
	NSBundle *bundle = [NSBundle mainBundle];
	NSString *path = [bundle pathForResource:aRessource ofType:aType];
	return path;
}

